import React, {useState} from 'react'

function TableBook(props) {
    const {books, onDelete} = props;

  return (
    <table>
        <tr>
            <td>Title</td>
            <td>Description</td>
        </tr>
        {books.map(book => {
            return (
                <tr key={book._id}>
                    <td>{book.title}</td>
                    <td>{book.description}</td>
                    <td><button onclick={()=>onDelete(book._id)}>Delete</button></td>
                </tr>
            )
        })}
    </table>
  )
}

export default TableBook
